<script>

	function replaceSpaceHTML(str) {
		var retVal = str;
		if ((typeof retVal === 'string')|| (retVal instanceof String)) {
			var lines = retVal.split('\n');
			retVal = "";
			for(var i = 0;i < lines.length;i++) {
				var newStr = lines[i].trim();
				retVal += newStr.replace(/\t/g, '').replace(/ /g, '&nbsp;').replace(/\r/g, '') + "<br \>";
			}
		}
		return retVal;
	}
	function loginAction(){
		document.location.href="screens/preframeset.html";
	}
	window.onload = function () {
		if(document.getElementById("loginBanner") !== null){
			document.getElementById("banner").innerHTML = replaceSpaceHTML(document.getElementById("loginBanner").value);
		}
		var message = "";

	  message = "2005 - ";

		document.getElementById("copyrightYear").innerHTML = "&copy "+ message + document.getElementById("systemtime").value;
	}
</SCRIPT>
